import React from 'react'

var stylingObject = {
    container: {
        display: "flex",
        width: "100%",
        height: "500px",
        background: "#FFFFF3",
        justifyContent: "center",
        alignItems: "center",

    },
    textContainer: {
        padding: "20px"
    },
    imageContainer: {
        paddingLeft: "80px"
    },
    image: {
        background: "black",
        width: "400px",
        height: "400px"
    }
}

function Hero() {
    return (
        <div style = {stylingObject.container}>
            <div style = {stylingObject.textContainer}>
                <h1>Header</h1>
                <h3>Subheader</h3>
            </div>
            <div style = {stylingObject.imageContainer}>
                <div style = {stylingObject.image}></div>
            </div>
        </div>
    )
}

export default Hero
